import 'package:test/test.dart';

getResult(String input) async {
  String text = '';
  final input = await PhotoRepositoryImpl().getPhotos(text);
  dynamic result;
  switch (input) {
    case Success<List<Hit>>():
      {
        switch (text) {
          case '바보':
            result = '바보가 아닙니다';
          default:
            input.data;
        }
      }
    case Error<List<Hit>>():
      result = '알 수 없는 네트워크 에러';
    default:
      {
        return result;
      }
  }
}

void main() {
  test('photo test', () async {
    String text = '노란 꽃';
    final result = await getResult(text);
    print(result);
  });

  test('photo test', () async {
    String text = '바보';
    final result = await getResult(text);
    print(result);
  });
}

